import axios from 'axios'
import MockAdapter from 'axios-mock-adapter'
import Mock from 'mockjs'

const mock = new MockAdapter(axios)
const Random = Mock.Random

const chinaAddress =  require('@/../public/china_address_v4.json')

mock.onGet('@/../public/china_address_v4.json').reply(config => {
    return [200, { data: chinaAddress }]
})
mock.onPost('/account/login').reply(config => {
    const body = JSON.parse(config.data)
    if (body.username === 'zhijian' && body.password === '123456') {
        const data = {
            username: body.username,
            role: 'ROLE_TENANT'
        }
        return [200, data]
    }
    return [600, {}]
})

const data = Mock.mock({
    'housing|10': [{
        id: '@increment()',
        rent: '@integer(1, 10000)',
        area: '@integer(1, 400)',

        city: '@city(true)',
        county: '@county()',
        region: '后海',
        community: '科苑新区',
        address: '创业路4号',
        floor: 10,
        towards: '东',
        // buiding: '5',
        // room: '603',

        nLivingroom: '@integer(1, 2)',
        nToilet: '@integer(1, 4)',
        nBedroom: '@integer(1, 4)',

        telephone: '13261806700'
    }]
})


mock.onGet('/housing').reply(config => {
    const params = config.params
    return [200, { data: data.housing[params.id] }]
})

mock.onGet('/housings').reply(config => {
    const params = config.params
    return [200, { data: data.housing }]
})
